import './css/App.css';
import Admin from './Admin'
import Anasayfa from './Anasayfa'
import { BrowserRouter,Route,Routes } from 'react-router-dom';


function App() {
  return (
    <BrowserRouter>
    <Routes>
    <Route exact path="/admin" element={<Admin/>}/>
    <Route exact path="/anasayfa" element={<Anasayfa/>}/>
     </Routes>
    </BrowserRouter>
  );
}

export default App;
